import React from "react";

const Weather = ({ weatherData }) => {
  console.log(weatherData);
  return (
    <div>
      {weatherData.map((weather) => (
        <div>
          <p>
            Minimum Temperature:
            {weather.data.forecast.forecastday.day.mintemp_c}
          </p>
        </div>
      ))}
    </div>
  );
};

export default Weather;
